package Feb23;

public class UnaryEx {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int i =10;
		System.out.println(i);
		
		i++; //11
		System.out.println(i);
		
		System.out.println(i++);
		
		System.out.println(i);
		
		i++; //13
		System.out.println(i); 
		
		i++;//14
		i++;//15
		System.out.println(i);
	}

}
